import React from "react";
import "./users.css";
import { DataGrid } from "@mui/x-data-grid";

const columns = [
  { field: "id", headerName: "ID", width: 70 },
  { field: "username", headerName: "userame", width: 130 },
  { field: "email", headerName: "Email", width: 130 },
  {
    field: "status",
    headerName: "Status",
    width: 90,
  },
  {
    field: "transaction",
    headerName: "transaction",
  },
];

const rows = [
  {
    id: 1,
    username: "John Snow",
    Avatar: "",
    email: "john@gmail.com",
    status: "active",
    transaction: "$120.00",
  },
  {
    id: 2,
    username: "John Snow",
    Avatar: "",
    email: "john@gmail.com",
    status: "active",
    transaction: "$200.00",
  },
  {
    id: 3,
    username: "John Snow",
    Avatar: "",
    email: "john@gmail.com",
    status: "active",
    transaction: "$170.00",
  },
  {
    id: 4,
    username: "John Snow",
    Avatar: "",
    email: "john@gmail.com",
    status: "active",
    transaction: "$250.00",
  },
  {
    id: 5,
    username: "John Snow",
    Avatar: "",
    email: "john@gmail.com",
    status: "active",
    transaction: "$100.00",
  },
  {
    id: 6,
    username: "John Snow",
    Avatar: "",
    email: "john@gmail.com",
    status: "active",
    transaction: "$300.00",
  },
];

export default function DataTable() {
  return (
    <div style={{ height: 400, width: "100%" }}>
      <DataGrid
        rows={rows}
        columns={columns}
        pageSize={9}
        rowsPerPageOptions={[5]}
        checkboxSelection
      />
    </div>
  );
}
